import React from "react";
import styled from 'styled-components';

const Styles = styled.div`
	.footer {
		display: flex;
		justify-content: center;
		align-items: center;
		background-color: black;
		color: white;
		position: absolute;
		opacity: 0.4;
		height: 70px;
		width: 100%;
		bottom: 0;
		z-index: 20000000;
	}

	.footer a {
		font-size: 20px;
		text-decoration: none;
		opacity: 1.0;
		color: rgba(0,0,0, .1);
	}

`;

function Footer() {
  return (
  <Styles>
    <div className="footer ">
      <header>Created by <a href={"https://github.com/elunaj"}>Elias Luna &nbsp;</a></header>
      <header>and <a href={"https://github.com/asgharm1999"}>Muhammad Asghar &nbsp; </a></header>
      <header>at <a href={"https://cunytechprep.nyc"}>CUNY Tech Prep</a></header>
    </div>
   </Styles>
  );
}

export default Footer;
